import React from 'react';

function Header({ isDarkMode, toggleTheme }) {
  return (
    <header className={`${isDarkMode ? 'bg-[#1F1F1F]' : 'bg-white'} shadow`}>
      <div className="max-w-7xl mx-auto py-4 px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center">
          <div className="flex items-center">
            <h1 className={`text-2xl font-bold text-[#FF8C00]`}>
              Code Mock
            </h1>
          </div>
          <button
            onClick={toggleTheme}
            className={`px-4 py-2 rounded-md focus:outline-none focus:ring-2 focus:ring-[#FF8C00] ${
              isDarkMode
                ? 'bg-[#121212] text-[#E0E0E0] hover:bg-[#2A2A2A]'
                : 'bg-[#FAFAFA] text-[#212121] hover:bg-[#F0F0F0]'
            }`}
          >
            {isDarkMode ? '‚òÄÔ∏è Light Mode' : 'üåô Dark Mode'}
          </button>
        </div>
      </div>
    </header>
  );
}

export default Header;
